configure:
  commands:
    end:
      new_state: execute
    ipv6 route 2009::/64 TenGigabitEthernet2/2/0/35 nexthop-vrf vrf1: "ipv6 route\
      \ 2009::/64 TenGigabitEthernet2/2/0/35 nexthop-vrf\b\b\b\b\b\b\b\b\b\b\b\b\b\
      \b\b\b\b\b\b\b\b\b\b\b\b\b\b\b\b\b\b\b\b\b\b\b\b\b\b\b\b\b\b\b\b\b\b\b\b\b\b\
      \b\b\b\b\b\b\b\b$2009::/64 TenGigabitEthernet2/2/0/35 nexthop-vrf          \b\
      \b\b\b\b\b\b\b\bvrf1\r\n"
    line console 0:
      new_state: configure_line
    no logging console: ''
  prompt: Stargazer(config)#
configure_line:
  commands:
    end:
      new_state: execute
    exec-timeout 0: ''
  prompt: Stargazer(config-line)#
connect:
  commands:
    ? ''
    : new_state: execute
  preface: 'Trying mock_device ...

    Connected to mock_device.

    Escape character is ''^]''.'
  prompt: ''
execute:
  commands:
    config term:
      new_state: configure
    config-transaction:
      new_state: configure
    show version: ''
    term length 0: ''
    term width 0: ''
  prompt: Stargazer#
